import React from 'react';

import './App.css';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

import Signin from './components/Auth/Signin/Signin';
import Signup from './components/Auth/Signup/Signup';
import ForgotPassword from './components/Auth/ForgotPassword/ForgotPassword';
import PrintData from './components/Invoice/Invoice';
import NotFound from './components/NotFound/NotFound';
import Defaultlayout from './components/dashboard/defaultLayout/defaultLayout'
import Forms from './components/dashboard/form/index';
import Updateform from './components/dashboard/updateForm/index';


